// src/pages/Dashboards.js
import React, { useState, useEffect } from "react";
import Header from "./Header";
import LeadCard from "../components/Leadscard";
import StatsCard from "./Statscard";
import AddLeadForm from "../components/AddLeadForm";
import Filters from "../components/Filters";
import axios from "axios";

const Dashboards = () => {
  const [leads, setLeads] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [selectedLead, setSelectedLead] = useState(null);

  // ðŸ”Ž Filters
  const [search, setSearch] = useState("");
  const [statusFilter, setStatusFilter] = useState("");
  const [sourceFilter, setSourceFilter] = useState("");

  // fetch function
  const fetchLeads = async () => {
    try {
      const response = await axios.get("http://localhost:5000/data");
      const fetched = response.data?.leads || [];
      setLeads(fetched);
    } catch (error) {
      console.error("Error fetching leads:", error);
      setLeads([]);
    }
  };

  useEffect(() => {
    fetchLeads();
  }, []);

  const handleAddNew = () => {
    setSelectedLead(null);
    setShowForm(true);
  };

  const handleEdit = (lead) => {
    setSelectedLead(lead);
    setShowForm(true);
  };

  // ðŸ”½ Apply Filters
  const filteredLeads = leads.filter((lead) => {
    const matchesSearch =
      search === "" ||
      lead.name?.toLowerCase().includes(search.toLowerCase()) ||
      lead.phone?.toLowerCase().includes(search.toLowerCase()) ||
      lead.destination?.toLowerCase().includes(search.toLowerCase());

    const matchesStatus =
      statusFilter === "" || lead.status === statusFilter;

    const matchesSource =
      sourceFilter === "" || lead.source === sourceFilter;

    return matchesSearch && matchesStatus && matchesSource;
  });

  // âœ… Stats
  const today = new Date();
  today.setHours(0, 0, 0, 0);

  const todaysFollowUps = leads.filter((l) => {
    if (!l.nextFollowUp) return false;
    const followUpDate = new Date(l.nextFollowUp);
    followUpDate.setHours(0, 0, 0, 0);
    return followUpDate.getTime() === today.getTime();
  });

  const stats = [
    { title: "Total Leads", count: leads.length, subtext: "+3 this week", icon: "bi-person", color: "#0d6efd" },
    { title: "Booked", count: leads.filter((l) => l.status === "Booked").length, subtext: "33% conversion", icon: "bi-check-circle", color: "#198754" },
    { title: "Lost", count: leads.filter((l) => l.status === "Lost").length, subtext: "Last 30 days", icon: "bi-x-circle", color: "#dc3545" },
    { title: "Today's Follow-ups", count: todaysFollowUps.length, subtext: `${todaysFollowUps.length} pending`, icon: "bi-calendar-event", color: "#fd7e14" },
  ];

  return (
    <div className="bg-light min-vh-100">
      <Header />

      <div className="container py-4">
        <div className="row mb-4">
          {stats.map((s, i) => (
            <StatsCard
              key={i}
              title={s.title}
              count={s.count}
              subtext={s.subtext}
              icon={<i className={`bi ${s.icon} fs-4`}></i>}
              color={s.color}
            />
          ))}
        </div>

        <div className="d-flex justify-content-between align-items-center mb-3">
          <h4 className="fw-bold">Leads</h4>
          <button className="btn btn-warning fw-semibold" onClick={handleAddNew}>
            <i className="bi bi-plus-lg me-1"></i> Add New Lead
          </button>
        </div>

        {/* ðŸ”½ Filters Component */}
        <Filters
          search={search}
          setSearch={setSearch}
          status={statusFilter}
          setStatus={setStatusFilter}
          source={sourceFilter}
          setSource={setSourceFilter}
        />

        <div className="row">
          {filteredLeads.length > 0 ? (
            filteredLeads.map((lead) => (
              <LeadCard key={lead._id} lead={lead} onEdit={() => handleEdit(lead)} />
            ))
          ) : (
            <p className="text-muted text-center">No leads found.</p>
          )}
        </div>
      </div>

      <AddLeadForm
        show={showForm}
        handleClose={() => { setShowForm(false); setSelectedLead(null); }}
        editLead={selectedLead}
        refreshLeads={fetchLeads}
      />
    </div>
  );
};

export default Dashboards;
